// src/pages/sizeGuide/sizeGuide.js
import React from 'react'; // 실제 컴포넌트 import
import MainPageHeader from '../mainPage/mainPage_header';
import MyPageCategory from '../component/myPage_category';
import SizeGuidePage from './sizeGuidePage';



function MainPage() {
    return (
        <div>
            <MainPageHeader />
            <MyPageCategory />
            <div className="mypage-body">
                <div className="menu-wrapper">
                </div>
            </div>
        </div>
    );
}

export default function SizeGuide() {
    return <SizeGuidePage />;
}
